{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amishkapuriya/google-data-analytics-capstone-project-by-amish?scriptVersionId=165217823\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"c264d547","metadata":{"_cell_guid":"778b490e-12ff-40db-b2a0-738c06061acd","_uuid":"2d5fc611-763a-496d-9cfa-e6b443d5eb97","papermill":{"duration":0.015538,"end_time":"2024-03-03T07:03:17.87131","exception":false,"start_time":"2024-03-03T07:03:17.855772","status":"completed"},"tags":[]},"source":["---\n","title: \"Cyclistic Bike Sharing Project\"\n","author: \"Amish H. Kapuriya\"\n","date: \"February 28, 2024\"\n","output: html_document\n","---\n","\n","## **Introduction**\n","\n","#### This is a case study for the Google Analytics Professional Certification course. Cyclistic, a fictional bike-share company located in Chicago, is looking to increase their membership numbers.\n","\n","### **Scenario**\n","\n","#### Cyclistic has more than 5,800 bicycles and over 600 docking stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime. The marketing director believes that maximizing the number of annual members will be key to future growth and is looking at a campaign to convert casual riders into members. You are a junior data analyst in the company and tasked with how Cyclistic members and casual riders use their bikes.\n","\n","## **1. Ask**\n","\n","### **Business Objective**\n","\n","#### Increase market share by converting casual riders into member through a targeted marketing campaign.\n","\n","#### **Stakeholders**\n","\n","-   Lily Moreno: Director of marketing, responsible for the development of campaigns.\n","-   Cyclistic marketing analytics team: The team responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy.\n","-   Cyclistic executive team: The executive team who will decide whether to approve the recommended marketing program.\n","\n","### **Business Task**\n","\n","#### How do annual members and casual riders use Cyclistic bikes differently?\n","\n","## **2. Prepare**\n","\n","### **Data Source**\n","\n","**The [data](https://divvy-tripdata.s3.amazonaws.com/index.html) provided has been made available by Motivate International Inc. under this [license](https://ride.divvybikes.com/data-license-agreement).**\n","\n","For this project, a year's data will be used, provided by Motivate in csv format.\n","\n","**ROCCC process:**\n","\n","-   **R** (reliable) - Collected by Motivate\n","-   **O** (original) - Yes\n","-   **C** (comprehensive) - Consisting of all rides taken\n","-   **C** (current) - current 12 months\n","-   **C** (cited) - Yes\n","\n","**Licensing, privacy, security, and accessibility**\n","\n","Data-privacy issues prohibit the use of riders’ personal information which means that casual riders might not all be from the Chicago service area.\n","\n","**Install required packages and libraries**"]},{"cell_type":"code","execution_count":1,"id":"1a6bff99","metadata":{"_cell_guid":"d5a108e4-8868-4f48-8242-e57e71bf0d00","_uuid":"e78de2b7-65a9-4f2c-80b8-ff690eb905c6","collapsed":false,"execution":{"iopub.execute_input":"2024-03-03T07:03:17.903838Z","iopub.status.busy":"2024-03-03T07:03:17.901629Z","iopub.status.idle":"2024-03-03T07:04:23.73765Z","shell.execute_reply":"2024-03-03T07:04:23.735008Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":65.855549,"end_time":"2024-03-03T07:04:23.741037","exception":false,"start_time":"2024-03-03T07:03:17.885488","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Insta