 the day\", title=\"Cyclistic's bike demand per hour by day of the week\") +\n","    facet_wrap(~ day_of_week)"]},{"cell_type":"markdown","id":"a3743d34","metadata":{"_cell_guid":"ff12fd7a-fd3a-4495-b6df-4ecddd88d5fe","_uuid":"a9623a39-3223-464c-973a-ea55d7942135","papermill":{"duration":0.029496,"end_time":"2024-03-03T07:09:25.675363","exception":false,"start_time":"2024-03-03T07:09:25.645867","status":"completed"},"tags":[]},"source":["There is a lot of difference between the weekdays and weekends. There is a big increase of volume in the weekdays between 7am to 10am and another volume increase from 5pm to 7pm.\n","\n","We can hypothesize that members use the bikes as daily routine like going to work (same behavior throughout the weekdays) and go back from work (5pm - 7pm).\n","\n","Weekends are completely different for members and casual riders, Friday, Saturday and Sunday there is huge peak in volume for casual riders, from this we can hypothesize that casual riders mostly use bike share for leisure activity in the weekends.\n","\n","### **Analysis and visualization of Rideable type Vs. total rides by Members and casual riders**"]},{"cell_type":"code","execution_count":24,"id":"e7a43180","metadata":{"_cell_guid":"950a649c-e763-4298-abc4-a730e3b67772","_uuid":"b07c26d7-aea0-41ee-9947-55543df03183","collapsed":false,"execution":{"iopub.execute_input":"2024-03-03T07:09:25.736955Z","iopub.status.busy":"2024-03-03T07:09:25.735246Z","iopub.status.idle":"2024-03-03T07:09:38.432159Z","shell.execute_reply":"2024-03-03T07:09:38.430149Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":12.731266,"end_time":"2024-03-03T07:09:38.435266","exception":false,"start_time":"2024-03-03T07:09:25.704","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 3 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>rideable_type</th><th scope=col>count</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;