papermill":{"duration":48.646453,"end_time":"2024-03-03T07:10:27.17207","exception":false,"start_time":"2024-03-03T07:09:38.525617","status":"completed"},"tags":[]},"outputs":[],"source":["#Lets check the coordinates data of the rides.\n","#adding a new data frame only for the most popular routes >200 rides\n","coordinates_df <- tripdata_clean %>% \n","filter(start_lng != end_lng & start_lat != end_lat) %>%\n","group_by(start_lng, start_lat, end_lng, end_lat, member_casual, rideable_type) %>%\n","summarise(total_rides = n(),.groups=\"drop\") %>%\n","filter(total_rides > 200)\n","\n","# now lets create two different data frames depending on rider type (member_casual)\n","\n","casual_riders <- coordinates_df %>% filter(member_casual == \"casual\")\n","member_riders <- coordinates_df %>% filter(member_casual == \"member\")"]},{"cell_type":"markdown","id":"ec46cb36","metadata":{"_cell_guid":"5aff0aa7-62f2-4507-b5ce-3eac864878aa","_uuid":"3b45c8bc-55f2-490c-bda8-4dce6416c49a","papermill":{"duration":0.030685,"end_time":"2024-03-03T07:10:27.233781","exception":false,"start_time":"2024-03-03T07:10:27.203096","status":"completed"},"tags":[]},"source":["## **5. Share**\n","\n","#### Create a csv file that we will visualize in Excel, Tableau, or the presentation software of choice."]},{"cell_type":"code","execution_count":26,"id":"541ec592","metadata":{"_cell_guid":"3b67a9d7-2202-470e-92a0-04501408bb7a","_uuid":"473e7074-3642-40f0-ab2f-663e505f8fd9","collapsed":false,"execution":{"iopub.execute_input":"2024-03-03T07:10:27.298809Z","iopub.status.busy":"2024-03-03T07:10:27.296985Z","iopub.status.idle":"2024-03-03T07:12:21.334632Z","shell.execute_reply":"2024-03-03T07:12:21.332607Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":114.073433,"end_time":"2024-03-03T07:12:21.337377","exception":false,"start_time":"2024-03-03T07:10:27.263944","status":"completed"},"tags":[]},"outputs":[],"source":["counts <- aggregate(tripdata_clean$ride_length ~ tripdata_clean$member_casual + tripdata_clean$day_of_week, FUN = mean)\n","\n","write.csv(tripdata_clean, file='tripdata_r1.csv')"]},{"cell_type":"markdown","id":"adba6ef5","metadata":{"_cell_guid":"649ed65c-791c-4f85-a6e0-d983c8147fa8","_uuid":"feaf534c-262c-47a2-a6b1-fb2736430b1f","papermill":{"duration":0.029922,"end_time":"2024-03-03T07:12:21.399874","exception":false,"start_time":"2024-03-03T07:12:21.369952","status":"completed"},"tags":[]},"source":["## **6. Act**\n","\n","### **Conclusion**\n","\n","#### **How do casual riders and members differ?**\n","\n","**Casual Riders**\n","\n","-   As the name suggest, casual riders use the service for leisure, recreational activities.\n","-   The service peaks during the summer months from May - July and for all periods, mostly weekends.\n","-   Classic and electric bikes are preferred over docked bikes.\n","-   The average time used is higher, nearly doubled, compared to members.\n","\n","**Members**\n","\n","-   Members use the service for going to and from work.\n","-   They are consistent in the use of the service the entire week.\n","-   Members prefer classic bikes.\n","-   The duration of use is nearly half that of casual riders.\n","-   More bikes are used by riders.\n","\n","#### **Recommendations**\n","\n","-   Offer a one-year promotional membership for first time members.\n","-   Special summer offers since summer is the peak period for casual riders.\n","-   Tie in cycling not only with exercise but saving the planet.\n","\n","*The marketing team can design their campaigns around these findings. They can allocated more resources during the summer months, weekends, at stations close to leisure spots etc.*"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":4510229,"sourceId":7747962,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"cod